import React from 'react';
import { Search } from 'react-bootstrap-icons';
import './index.css';

function SearchBar() {
    return (
        <div className="lf_search">
            <div className="lf_search-input p-2">
                <input placeholder="Search for video" style={{
                    width: '80%'
                }}/>
            </div>
            <div className="lf_search-icon m-2">
                <Search />
            </div>
        </div>
    )
}

export default SearchBar;
